import{_ as a,c as t,o as s,ag as i}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"RESET","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/RESET.md","filePath":"docs/7x/ref_guide/sql_commands/RESET.md"}'),o={name:"docs/7x/ref_guide/sql_commands/RESET.md"};function n(r,e,l,d,c,p){return s(),t("div",null,e[0]||(e[0]=[i(`<h1 id="reset" tabindex="-1">RESET <a class="header-anchor" href="#reset" aria-label="Permalink to &quot;RESET&quot;">​</a></h1><p>Restores the value of a run-time system configuration parameter to the default value.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>RESET &lt;configuration_parameter&gt;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>RESET ALL</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>RESET</code> restores system configuration parameters to their default values. <code>RESET</code> is an equivalent command for</p><div class="language-sql vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">SET</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">configuration_parameter</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> TO</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> DEFAULT</span></span></code></pre></div><p>Refer to <a href="./SET.html">SET</a> for details.</p><p>The default value is defined as the value that the parameter would have had, had no <code>SET</code> ever been issued for it in the current session. The actual source of this value might be a compiled-in default, the coordinator <code>postgresql.conf</code> configuration file, command-line options, or per-database or per-user default settings. This is subtly different from defining it as &quot;the value that the parameter had at session start&quot;, because if the value came from the configuration file, it will be reset to whatever is specified by the configuration file now. See <a href="./../config_params/guc_config.html">Server Configuration Parameters</a> for more information.</p><p>The transactional behavior of <code>RESET</code> is the same as <code>SET</code>: its effects will be undone by transaction rollback.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>configuration_parameter : The name of a settable run-time system configuration parameter. See <a href="./../config_params/guc_config.html">Server Configuration Parameters</a> for details.</p><p>ALL : Resets all settable run-time configuration parameters to their default values.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Set the <code>statement_mem</code> configuration parameter to its default value:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>RESET statement_mem;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>RESET</code> is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./SET.html">SET</a>, <a href="./SHOW.html">SHOW</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,21)]))}const m=a(o,[["render",n]]);export{u as __pageData,m as default};
